ens.com"],"shape":[34],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["Microchip Technology Incorporated develops, manufactures, and sells smart, connected, and secure embedded control solutions in the Americas, Europe, and Asia. The company offers general purpose 8-bit, 16-bit, and 32-bit microcontrollers; 32-bit embedded microprocessors markets; and specialized microcontrollers for automotive, industrial, computing, communications, lighting, power supplies, motor control, human machine interface, security, wired connectivity, and wireless connectivity applications. It also provides development tools that enable system designers to program microcontroller and microprocessor products for specific applications; field-programmable gate array (FPGA) products; and analog, interface, mixed signal, and timing products comprising power management, linear, mixed-signal, high-voltage, thermal management, discrete diodes and metal oxide semiconductor field effect transistors (MOSFETS), radio frequency (RF), drivers, safety, security, timing, USB, Ethernet, wireless, and other interface products. In addition, the company offers memory products consisting of serial electrically erasable programmable read-only memory, serial flash memories, parallel flash memories, serial static random access memories, and serial electrically erasable random access memories for the production of very small footprint devices; and licenses its SuperFlash embedded flash and NVM technologies to foundries, integrated device manufacturers, and design partners for use in the manufacture of microcontroller products, gate array, RF, analog, and neuromorphic compute products that require embedded non-volatile memory, as well as provides engineering services. Further, it offers wafer foundry and assembly, and test subcontracting manufacturing services; and timing systems products, application specific integrated circuits, and aerospace products. Microchip Technology Incorporated was incorporated in 1989 and is headquartered in Chandler, Arizona.","Teradyne, Inc. designs, develops, manufactures, sells, and supports automatic test equipment worldwide. The company operates through Semiconductor Test, System Test, Industrial Automation, and Wireless Test segments. The Semiconductor Test segment offers products and services for wafer level and device package testing in automotive, industrial, communications, consumer, smartphones, cloud computer and electronic game, and other applications. This segment also provides FLEX test platform systems; J750 test system to address the volume semiconductor devices; Magnum platform that tests memory devices, such as flash memory and DRAM; and ETS platform for semiconductor manufacturers, and assembly and test subcontractors in the analog/mixed signal markets. It serves integrated device manufacturers that integrate the fabrication of silicon wafers into their business; fabless companies that outsource the manufacturing of silicon wafers; foundries; and semiconductor assembly and test providers. The System Test segment offers defense/aerospace test instrumentation and systems; storage test systems; and circuit-board test and inspection systems. The Industrial Automation segment provides collaborative robotic arms, autonomous mobile robots, and advanced robotic control software for manufacturing, logistics, and light industrial customers. The Wireless Test segment provides test solutions for use in the development and manufacture of wireless devices and modules, smartphones, tablets, notebooks, laptops, peripherals, and Internet-of-Things devices under the LitePoint brand name. This segment also offers IQxel products for Wi-Fi and other standards; IQxstream solution for testing GSM, EDGE, CDMA2000, TD-SCDMA, WCDMA, HSPA+, LTE, and 5G technologies; IQcell, a multi-device cellular signaling test solution; IQgig test solution; and turnkey test software for wireless chipsets. Teradyne, Inc. was incorporated in 1960 and is headquartered in North Reading, Massachusetts.","Analog Devices, Inc. designs, manufactures, tests, and markets integrated circuits (ICs), software, and subsystems that leverage analog, mixed-signal, and digital signal processing technologies. The company provides data converter products, which translate real-world analog signals into digital data, as well as translates digital data into analog signals; power management and reference products for power conversion, driver monitoring, sequencing, and energy management applications in the automotive, communications, industrial, and high-end consumer markets; and power ICs include performance, integration, and software design simulation tools for accurate power supply designs. It also offers high-performance amplifiers to condition analog signals; and radio frequency and microwave ICs to support cellular infrastructure; and microelectromechanical systems technology solutions, including accelerometers used to sense acceleration, gyroscopes for sense rotation, inertial measurement units to sense multiple degrees of freedom, and broadband switches for radio and instrument systems, as well as isolators. In addition, the company offers digital signal processing and system products for high-speed numeric calculations. It serves clients in the industrial, automotive, consumer, instrumentation, aerospace, and communications markets through a direct sales force, third-party distributors, and independent sales representatives in the United States, the rest of North and South America, Europe, Japan, China, and rest of Asia, as well as through its Website. Analog Devices, Inc. was incorporated in 1965 and is headquartered in Wilmington, Massachusetts.","Halliburton Company provides products and services to the energy industry worldwide. It operates in two segments, Completion and Production, and Drilling and Evaluation. The Completion and Production segment offers production enhancement services that include stimulation and sand control services; cementing services, such as well bonding and casing, and casing equipment; completion tools that offer downhole solutions and services, including well completion products and services, intelligent well completions, and service tools, as well as liner hanger, sand control, and multilateral systems; production solutions comprising coiled tubing, hydraulic workover units, downhole tools, and pumping and nitrogen services; and pipeline and process services, such as pre-commissioning, commissioning, maintenance, and decommissioning. This segment also provides electrical submersible pumps, as well as artificial lift services. The Drilling and Evaluation segment offers drilling fluid systems, performance additives, completion fluids, solids control, specialized testing equipment, and waste management services; oilfield completion, production, and downstream water and process treatment chemicals and services; drilling systems and services; wireline and perforating services consists of open-hole logging, and cased-hole and slickline; and drill bits and services comprising roller cone rock bits, fixed cutter bits, hole enlargement, and related downhole tools and services, as well as coring equipment and services. This segment also provides cloud based digital services and artificial intelligence solutions on an open architecture for subsurface insights, integrated well construction, and reservoir and production management; testing and subsea services, such as acquisition and analysis of reservoir information and optimization solutions; and project management and integrated asset management services. Halliburton Company was founded in 1919 and is based in Houston, Texas.","Marsh &amp; McLennan Companies, Inc., a professional services company, provides advice and solutions to clients in the areas of risk, strategy, and people worldwide. It operates in two segments, Risk and Insurance Services, and Consulting. The Risk and Insurance Services segment offers risk management services, such as risk advice, risk transfer, and risk control and mitigation solutions, as well as insurance and reinsurance broking, catastrophe and financial modeling, and related advisory services; and insurance program management services. This segment serves businesses, public entities, insurance companies, associations, professional services organizations, and private clients. The Consulting segment provides health, wealth, and career consulting services and products; and specialized management, as well as economic and brand consulting services. Marsh &amp; McLennan Companies, Inc. was founded in 1871 and is headquartered in New York, New York.","Gen Digital Inc. provides cyber safety solutions for consumers in the United States, Canada, Latin America, Europe, the Middle East, Africa, the Asia Pacific, and Japan. It offers Norton 360, an integrated platform provides extensive cyber safety coverage and a subscription service providing protection for PCs, Macs, and mobile devices against malware, viruses, adware, ransomware, and other online threats on various platforms; and Norton and LifeLock identity theft protection solution that offers monitoring, alerts, and restoration services to its customers. The company also provides Norton Secure VPN solution, which enhances security and online privacy by providing an encrypted data tunnel; Privacy Monitor Assistant, an on-demand, white glove service where agents help members delete personal information from data brokers online; Home Title Protect product that detects fraud and notifies members; and Avira Security, a consumer-focused portfolio of cybersecurity and privacy solutions. It offers Dark Web Monitoring product, which looks for personal information of its Norton 360 members on the Dark Web; and Social Media Monitoring solution that helps to keep customers' social media accounts safer by monitoring them for account takeovers, risky activity, and inappropriate content. The company also provides AntiTrack product, which helps to keep personal information and browsing activity private by blocking trackers and disguising digital fingerprints online; and Online Reputation Management solution that manages online search results, personal branding, and digital privacy. It markets and sells its products and related services through retailers, telecom service providers, hardware original equipment manufacturers, and employee benefit providers, as well as e-commerce platform. The company was formerly known as NortonLifeLock Inc. and changed its name to Gen Digital Inc. in November 2022. Gen Digital Inc. was founded in 1982 and is based in Tempe, Arizona.","Chord Energy Corporation operates as an independent exploration and production company. It acquires, exploits, develops, and explores for crude oil, natural gas, and natural gas liquids in the Williston Basin. The company was founded in 2007 and is headquartered in Houston, Texas.","Eastern Bankshares, Inc. operates as the bank holding company for Eastern Bank that provides banking products and services primarily to retail, commercial, and small business customers. It operates in two segments, Banking Business and Insurance Agency Business. The company provides interest-bearing and non interest-bearing checking deposits, money market deposits, savings deposits, and time certificates of deposits, as well as debit and credit cards. It also offers commercial and industrial loans, commercial real estate and construction loans, small business loans, residential real estate loans, home equity, and lines of credit, as well as other consumer loans comprising unsecured personal lines of credit, overdraft protection, automobile loans, home improvement loans, airplane loans, and other personal loans. In addition, the company provides cash reserves, cash management, merchant, escrow express, government banking, international banking, interest on lawyers trust accounts, retirement planning, and business telephone banking services, as well as products and services for not-for-profit and healthcare. Further, it offers trust and investment products and services; community development and asset-based lending services; financial planning, portfolio management, wealth management, private banking, and fiduciary products; online, mobile, and telephone banking services; and automated lock box collection and account reconciliation services, as well as various insurance products. As of December 31, 2021, the company operated 105 branch offices in eastern Massachusetts and southern New Hampshire; and 23 non-branch offices in eastern Massachusetts, one office in New Hampshire, and one office in Rhode Island. Eastern Bankshares, Inc. was founded in 1818 and is headquartered in Boston, Massachusetts.","ExlService Holdings, Inc. operates as a data analytics, and digital operations and solutions company in the United States and internationally. It operates through Insurance, Healthcare, Analytics, and Emerging Business segments. The company provides digital operations and solutions and analytics-driven services across the insurance industry in areas, such as claims processing, premium and benefit administration, agency management, account reconciliation, policy research, underwriting support, new business acquisition, policy servicing, premium audit, surveys, billing and collection, commercial and residential survey, and customer service using digital technology, artificial intelligence, machine learning, and advanced automation; digital customer acquisition services using a software-as-a-service delivery model through LifePRO and LISS platforms; subrogation services; and Subrosource software platform, an end-to-end subrogation platform. It also offers CareRadius, an integrated care management offering; and health care services related to care management, utilization management, disease management, payment integrity, revenue optimization and customer engagement to healthcare payers, providers, pharmacy benefit managers, and life sciences organizations. Further, it offers predictive and prescriptive analytics in the areas of customer acquisition and lifecycle management, risk underwriting and pricing, operational effectiveness, credit and operational risk monitoring and governance, payment integrity and care management, and data management. The company was founded in 1999 and is headquartered in New York, New York.","Celsius Holdings, Inc. develops, processes, markets, distributes, and sells functional drinks and liquid supplements in North America, Europe, Asia, and internationally. It offers various carbonated and non-carbonated functional energy drinks under the CELSIUS Originals name; dietary supplement in carbonated flavors, including apple jack'd, orangesicle, inferno punch, cherry lime, blueberry pomegranate, strawberry dragon fruit, tangerine grapefruit, and jackfruit under the CELSIUS HEAT name; and branched-chain amino acids functional energy drink that fuels muscle recovery under the CELSIUS BCCA+ENERGY name. The company also provides CELSIUS On-the-Go, a powdered form of the active ingredients in functional energy drinks in individual On-The-Go packets and canisters; and sparkling grapefruit, cucumber lime, and orange pomegranate, as well as pineapple coconut, watermelon berry, and strawberries and cream non-carbonated functional energy drinks under the CELSIUS Sweetened. It distributes its products through direct-to-store delivery distributors and direct to retailers, including supermarkets, convenience stores, drug stores, nutritional stores, and mass merchants, as well as health clubs, spas, gyms, the military, and e-commerce websites. The company was formerly known as Vector Ventures, Inc. and changed its name to Celsius Holdings, Inc. in January 2007. Celsius Holdings, Inc. was founded in 2004 and is headquartered in Boca Raton, Florida.","Tesla, Inc. designs, develops, manufactures, leases, and sells electric vehicles, and energy generation and storage systems in the United States, China, and internationally. It operates in two segments, Automotive, and Energy Generation and Storage. The Automotive segment offers electric vehicles, as well as sells automotive regulatory credits; and non-warranty after-sales vehicle, used vehicles, retail merchandise, and vehicle insurance services. This segment also provides sedans and sport utility vehicles through direct and used vehicle sales, a network of Tesla Superchargers, and in-app upgrades; purchase financing and leasing services; services for electric vehicles through its company-owned service locations and Tesla mobile service technicians; and vehicle limited warranties and extended service plans. The Energy Generation and Storage segment engages in the design, manufacture, installation, sale, and leasing of solar energy generation and energy storage products, and related services to residential, commercial, and industrial customers and utilities through its website, stores, and galleries, as well as through a network of channel partners; and provision of service and repairs to its energy product customers, including under warranty, as well as various financing options to its solar customers. The company was formerly known as Tesla Motors, Inc. and changed its name to Tesla, Inc. in February 2017. Tesla, Inc. was incorporated in 2003 and is headquartered in Austin, Texas.","Aehr Test Systems provides test systems for burning-in and testing logic, optical, and memory integrated circuits worldwide. It offers products, such as the ABTS and FOX-P families of test and burn-in systems and FOX WaferPak Aligner, FOX-XP WaferPak Contactor, FOX DiePak Carrier, and FOX DiePak Loader. The ABTS system is used in production and qualification testing of packaged parts for lower power and higher power logic devices, as well as various common types of memory devices. The FOX-XP and FOX-NP systems are wafer contact and singulated die/module test and burn-in systems used for burn-in and functional test of complex devices, such as memories, digital signal processors, microprocessors, microcontrollers, systems-on-a-chip, and integrated optical devices. The FOX-CP system is a single-wafer compact test and reliability verification solution for logic, memory, and photonic devices. The WaferPak Contactor contains a unique full wafer probe card capable of testing wafers up to 300mm that enables IC manufacturers to perform test and burn-in of full wafers on Aehr Test FOX systems. The DiePak Carrier is a reusable, temporary package that enables IC manufacturers to perform final test and burn-in of bare die and modules. Aehr Test Systems was incorporated in 1977 and is headquartered in Fremont, California.","Alliance Resource Partners, L.P., a diversified natural resource company, produces and markets coal primarily to utilities and industrial users in the United States. The company operates through four segments: Illinois Basin Coal Operations, Appalachia Coal Operations, Oil &amp; Gas Royalties, and Coal Royalties. It produces a range of thermal and metallurgical coal with sulfur and heat contents. The company operates seven underground mining complexes in Illinois, Indiana, Kentucky, Maryland, Pennsylvania, and West Virginia. In addition, it leases land and operates a coal loading terminal on the Ohio River at Mt. Vernon, Indiana; and buys and resells coal, as well as owns mineral and royalty interests in approximately 1.5 million gross acres of oil and gas producing regions primarily in the Permian, Anadarko, and Williston Basins. Further, the company offers various mining technology products and services, including data network, communication and tracking systems, mining proximity detection systems, industrial collision avoidance systems, and data and analytics software. As of December 31, 2021, it had approximately 547.1 million tons of proven and probable coal mineral reserves, as well as 1.17 billion tons of measured, indicated, and inferred coal mineral resources in Illinois, Indiana, Kentucky, Maryland, Pennsylvania, and West Virginia. The company was founded in 1971 and is headquartered in Tulsa, Oklahoma.","Allegro MicroSystems, Inc. designs, develops, manufactures, and markets sensor integrated circuits (ICs) and application-specific analog power ICs for motion control and energy-efficient systems. Its products include magnetic sensor ICs, such as position, speed, and current sensor ICs; power ICs comprising motor driver ICs, and regulator and LED driver ICs; and photonic and 3D sensing components, including photodiodes, eye-safe lasers, and readout ICs for LiDAR applications. The company sells its products to original equipment manufacturers and suppliers primarily in the automotive and industrial markets through its direct sales force, third party distributors, independent sales representatives, and consignment. It operates in the United States, rest of the Americas, Europe, Japan, Greater China, South Korea, and other Asian markets. The company was founded in 1990 and is headquartered in Manchester, New Hampshire. Allegro MicroSystems, Inc. is a subsidiary of Sanken Electric Co., Ltd.","The Vita Coco Company, Inc. develops, markets, and distributes coconut water products under the Vita Coco brand name in the United States, Canada, Europe, the Middle East, and the Asia Pacific. The company offers coconut oil and coconut milk; Hydration Drink Mix, a powdered form of flavored coconut water; sparkling water; Runa, a plant-based energy drink; purified water under the Ever &amp; Ever brand name; and PWR LIFT, a protein-infused fitness drink. It distributes its products through club, food, drug, mass, convenience, e-commerce, and foodservice channels. In addition, the company supplies coconut water and coconut oil categories to retailers. The company was formerly known as All Market Inc. and changed its name to The Vita Coco Company, Inc. in September 2021.The Vita Coco Company, Inc. was founded in 2004 and is headquartered in New York, New York.","Chuy's Holdings, Inc., through its subsidiaries, owns and operates full-service restaurants under the Chuy's name in the United States. As of December 26, 2021, it operated 96 restaurants in 17 states, including the Southeastern and Midwestern United States. The company was founded in 1982 and is headquartered in Austin, Texas.","Aethlon Medical, Inc., a medical technology company, focuses on developing products to diagnose and treat life and organ threatening diseases in the United States. The company develops Aethlon Hemopurifier, a clinical-stage immunotherapeutic device that removes tumor-derived exosomes and life-threatening viruses from the human circulatory system, including removal of COVID-19 virus, associated variants, and related exosomes. Aethlon Medical, Inc. has a collaboration with the University of Pittsburgh Medical Center Hillman Cancer Center for studies related to head and neck cancer. The company was founded in 1999 and is based in San Diego, California.","Caesarstone Ltd., together with its subsidiaries, develops, manufactures, and markets engineered quartz and other surfaces under the Caesarstone brand in the United States, Australia, Canada, Latin America, Asia, Israel, Europe, the Middle East, and Africa. The company's engineered quartz slabs are primarily used as indoor and outdoor kitchen countertops in the renovation and remodeling construction end markets. Its products are also used in other applications, such as vanity tops, wall panels, back splashes, floor tiles, stairs, furniture, and other interior and exterior surfaces that are used in various residential and non-residential applications. The company also offers porcelain products under the Lioli brand for flooring and cladding applications, as well as resells natural stones, various ancillary fabrication tools, and installation accessories; and sells sinks and materials. It sells its products directly to fabricators, sub-distributors, and resellers; and through direct sales force and indirect network of independent distributors. The company was formerly known as Caesarstone Sdot Yam Ltd. and changed its name to Caesarstone Ltd. in June 2016. Caesarstone Ltd. was founded in 1987 and is headquartered in Menashe, Israel.","Cisco Systems, Inc. designs, manufactures, and sells Internet Protocol based networking and other products related to the communications and information technology industry in the Americas, Europe, the Middle East, Africa, the Asia Pacific, Japan, and China. It provides infrastructure platforms, including networking technologies of switching, routing, wireless, and data center products that are designed to work together to deliver networking capabilities, and transport and/or store data. The company also offers collaboration products comprising unified communications, Cisco TelePresence, and conferencing, as well as the Internet of Things and analytics software. In addition, it provides security products, such as network security, cloud and email security, identity and access management, advanced threat protection, and unified threat management products. Further, the company offers a range of service and support options for its customers, including technical support and advanced services. It serves businesses of various sizes, public institutions, governments, and service providers. The company sells its products and services directly, as well as through systems integrators, service providers, other resellers, and distributors. Cisco Systems, Inc. has strategic alliances with other companies. Cisco Systems, Inc. was incorporated in 1984 and is headquartered in San Jose, California.",{"type":"number","value":"nan"},"CSW Industrials, Inc. operates as a diversified industrial company in the United States and internationally. It operates through three segments: Contractor Solutions, Engineered Building Solutions, and Specialized Reliability Solutions. The Contractor Solutions segment provides cements, diffusers, grilles, registers, solvents, thread sealants, traps, and vents for use in HVAC/R, plumbing, general industrial, architecturally, and specified building products. The Engineered Building Solutions segment offers architectural railings and associated services; fire and smoke protection solutions; and pre-engineered and custom architectural building components for use in architecturally specified building products. The Specialized Reliability Solutions segment provides compounds, lubricants, lubricant management products, and sealants; and contamination control, industrial maintenance and repair, and operations solutions for use in energy, general industrial, mining, and railing markets. The company was incorporated in 2014 and is headquartered in Dallas, Texas.","Cavco Industries, Inc. designs, produces, and retails manufactured homes primarily in the United States. It operates in two segments, Factory-Built Housing and Financial Services. The company markets its manufactured homes under the Cavco, Fleetwood, Palm Harbor, Nationwide, Fairmont, Friendship, Chariot Eagle, Destiny, Commodore, Colony, Pennwest, R-Anell, Manorwood, and MidCountry brands. It also builds park model RVs; vacation cabins; and factory-built commercial structures, including apartment buildings, condominiums, hotels, workforce housing, schools, and housing for the United States military troops. In addition, the company produces various modular homes, which include single and multi-section ranch, split-level, and Cape Cod style homes, as well as two- and three-story homes, and multi-family units. Further, it provides conforming and non-conforming mortgages and home-only loans to purchasers of various brands of factory-built homes sold by company-owned retail stores, as well as various independent distributors, builders, communities, and developers. Additionally, the company offers property and casualty insurance to owners of manufactured homes. As of April 3, 2022, it operated 45 company-owned retail stores in Oregon, Arizona, Nevada, New Mexico, Texas, Indiana, Oklahoma, Florida, and New York. The company also distributes its homes through a network of independent distribution points in 48 states and Canada; and through planned community operators and residential developers. Cavco Industries, Inc. was founded in 1965 and is headquartered in Phoenix, Arizona.","Commercial Vehicle Group, Inc., together with its subsidiaries, designs, manufactures, produces, and sells components and assemblies in North America, Europe, and the Asia-Pacific regions. It operates in four segments: Vehicle Solutions, Warehouse Automation, Electrical Systems, and Aftermarket &amp; Accessories. The company offers electrical wire harness assemblies that function as current carrying devices in providing electrical interconnections for gauges, lights, control functions, power circuits, powertrain and transmission sensors, emissions systems, and other electronic applications on commercial and other vehicles; and panel assemblies. It also offers electro-mechanical assemblies, such as box builds, complex automated and robotic assemblies, and large multi-cabinet control cabinets with power distribution and cabling; vinyl or cloth-covered appliqu\u00e9s, armrests, map pocket compartments, and sound-reducing insulations; instrument panels; and plastics decorating and finishing products. In addition, it provides cab structures; design products, including armrests, grab handles, storage systems, floor coverings, floor mats, sleeper bunks, headliners, wall panels, and privacy curtains; and mirrors, wipers, and controls used in commercial, military and specialty recreational vehicles. Further, it offers seats and seating systems, such as mechanical and air suspension, static and military seats, and bus, as well as seats for medium-and heavy-duty trucks (MD/HD trucks); office seating products; and seats, parts, and components for the aftermarket. The company supplies its products and systems for the commercial vehicle market comprising the MD/HD truck market; and MD/HD truck, bus, construction, mining, agricultural, military, industrial, municipal, off-road recreational, and specialty vehicle markets. Commercial Vehicle Group, Inc. was incorporated in 2000 and is headquartered in New Albany, Ohio.","Codorus Valley Bancorp, Inc. operates as the bank holding company for the PeoplesBank that provides community banking services. The company accepts demand, money market, time, and savings deposits, as well as certificates of deposit. It also offers commercial loans, such as builder and developer, commercial and residential real estate investor, hotel/motel, wholesale and retail, agriculture, manufacturing, and other loans; consume loans, including residential mortgage, home equity, and others. In addition, the company provides mortgage and wealth management services; and sells non-deposit investment products. It operates through twenty-five full service financial centers located in South Central Pennsylvania and Central Maryland. The company was founded in 1864 and is headquartered in York, Pennsylvania.","Dorchester Minerals, L.P. engages in the acquisition, ownership, and administration of producing and nonproducing natural gas and crude oil royalty, net profit, and leasehold interests in the United States. Its royalty properties consist of producing and nonproducing mineral, royalty, and overriding royalty interests located in 582 counties and parishes in 26 states; and net profits interests represent net profits overriding royalty interests in various properties owned by the operating partnership. Dorchester Minerals Management LP serves as the general partner of Dorchester Minerals, L.P. The company was founded in 1982 and is based in Dallas, Texas.","DXP Enterprises, Inc., together with its subsidiaries, engages in distributing maintenance, repair, and operating (MRO) products, equipment, and services to the energy and industrial customers primarily in the United States and Canada. It operates through three segments: Service Centers (SC), Supply Chain Services (SCS), and Innovative Pumping Solutions (IPS). The SC segment offers MRO products, equipment, and integrated services, including technical expertise and logistics services. It offers a range of MRO products in the rotating equipment, bearing, power transmission, hose, fluid power, metal working, fastener, industrial supply, safety products, and safety services categories. This segment serves customers in the oil and gas, food and beverage, petrochemical, transportation, other general industrial, mining, construction, chemical, municipal, agriculture, and pulp and paper industries. The SCS segment manages procurement and inventory management solutions; and offers outsourced MRO solutions for sourcing MRO products, including inventory optimization and management, store room management, transaction consolidation and control, vendor oversight and procurement cost optimization, productivity improvement, and customized reporting services. Its programs include SmartAgreement, a procurement solution for various MRO categories; SmartBuy, an on-site or centralized MRO procurement solution; SmartSource, an on-site procurement and storeroom management solution; SmartStore, an e-Catalog solution; SmartVend, an industrial dispensing solution; and SmartServ, an integrated service pump solution. The IPS segment fabricates and assembles custom-made pump packages, remanufactures pumps, and manufactures branded private label pumps. The company was founded in 1908 and is based in Houston, Texas.","Eltek Ltd. manufactures, markets, and sells printed circuit boards (PCBs) in Israel, Europe, North America, India, the Netherlands, and internationally. The company offers a range of custom designed PCBs, including rigid, double-sided, and multi-layer PCBs, and flexible circuitry boards. It also offers high density interconnect, flex-rigid, and multi-layered boards. It primarily serves manufacturers of defense and aerospace, medical, industrial, telecom, and networking equipment, as well as contract electronic manufacturers and others. The company markets and sells its products primarily through direct sales personnel, sales representatives, and PCB trading and manufacturing companies. Eltek Ltd. was incorporated in 1970 and is headquartered in Petach Tikva, Israel. Eltek Ltd. is a subsidiary of Nistec Golan Ltd.","Erie Indemnity Company operates as a managing attorney-in-fact for the subscribers at the Erie Insurance Exchange in the United States. The company provides sales, underwriting, policy issuance, and renewal services for the policyholders on behalf of the Erie Insurance Exchange. It also offers sales related services, including agent compensation, and sales and advertising support services; and underwriting services comprise underwriting and policy processing; and other services consist of customer services and administrative support services, as well as information technology services. Erie Indemnity Company was incorporated in 1925 and is based in Erie, Pennsylvania.","Euroseas Ltd. provides ocean-going transportation services worldwide. The company owns and operates containerships that transport dry and refrigerated containerized cargoes, including manufactured products and perishables. As of May 03, 2022, it had a fleet of 18 vessels, including 10 feeder and 8 intermediate containerships with a cargo capacity of approximately 58,871 twenty-foot equivalent unit (teu). The company was incorporated in 2005 and is based in Marousi, Greece.","Energy Services of America Corporation provides contracting services for utilities and energy related companies in the United States. It constructs, replaces, and repairs interstate and intrastate natural gas pipelines and storage facilities for utility companies and private natural gas companies; and provides services relating to pipeline, storage facilities, and plant works. The company also offers a range of electrical and mechanical installation, and repair services, including substation and switchyard, site preparation, equipment setting, pipe fabrication and installation, packaged buildings, transformers, and other ancillary works for the gas, petroleum power, chemical, water and sewer, and automotive industries. It provides liquid pipeline and pump station construction, production facility construction, water and sewer pipeline installation, and various maintenance and repair services, as well as other services related to pipeline construction. The company serves customers primarily in West Virginia, Virginia, Ohio, Pennsylvania, and Kentucky. Energy Services of America Corporation was incorporated in 2006 and is based in Huntington, West Virginia.","Esquire Financial Holdings, Inc. operates as the bank holding company for Esquire Bank, National Association that provides commercial banking products and services to legal industry and small businesses, and commercial and retail customers in the United States. The company offers checking, savings, money market, and time deposits, as well as certificates of deposit. It also provides commercial loans, including short-term financing for inventory, receivables, the purchase of supplies, or other operating needs arising during the normal course of business, as well as loans to its qualified merchant customers; commercial lines of credit; consumer loans consisting of post-settlement consumer and structured settlement loans to plaintiffs and claimants, as well as loans to individuals for debt consolidation, medical expenses, living expenses, payment of outstanding bills, or other consumer needs; and real estate loans, such as multifamily, 1-4 family residential, commercial real estate, and construction loans, as well as merchant services. As of January 25, 2022, the company operated a full-service branch in Jericho, New York; and an administrative office in Boca Raton, Florida. Esquire Financial Holdings, Inc. was founded in 2006 and is headquartered in Jericho, New York.","Extreme Networks, Inc. provides software-driven networking solutions worldwide. It designs, develops, and manufactures wired and wireless network infrastructure equipment; and develops software for network management, policy, analytics, security, and access controls. The company offers ExtremeCloud IQ, an ML/AI powered, wired, and wireless cloud network management solution that offers advanced visibility and control over users, devices, and applications; ExtremeCloud IQ \u0096 Site Engine that provides task automation, access control, granular visibility with real-time analytics and multi-vendor device management; and ExtremeCloud IQ Essentials offers WIPS, location services, IoT, and guest management services. It also provides wireless access point products; ExtremeSwitching portfolio that includes access edge products that offer physical presentations along with options to deliver Ethernet or convergence-friendly Power-over-Ethernet (POE), including high-power universal POE; aggregation/core switches designed to address aggregation, top-of-rack, and campus core environments; and data center switches and routers. In addition, the company offers cloud native platforms and applications for service providers; and customer support and services. It markets and sells its products through distributors, resellers, and field sales organizations to healthcare, education, government, manufacturing, retail, and hospitality markets. Extreme Networks, Inc. was incorporated in 1996 and is headquartered in Morrisville, North Carolina.","First Business Financial Services, Inc. operates as the bank holding company for First Business Bank that provides commercial banking products and services for small and medium-sized businesses, business owners, executives, professionals, and high net worth individuals. The company offers deposit products, such as non-interest-bearing transaction accounts, interest-bearing transaction accounts, money market accounts, time deposits, and certificates of deposit, as well as credit cards. It also provides loan products, including commercial real estate loans, commercial and industrial loans, small business administration loans, and direct financing leases, as well as consumer and other loans comprising home equity, first and second mortgage, and other personal loans for professional and executive clients. The company offers commercial lending, asset-based lending, equipment financing, accounts receivable financing, vendor financing, floorplan financing, treasury management services, and company retirement plans; trust and estate administration, financial planning, investment management, and private banking services; and investment portfolio administrative, asset-liability management, and asset-liability management process validation services for other financial institutions. First Business Financial Services, Inc. was founded in 1909 and is headquartered in Madison, Wisconsin.","First Citizens BancShares, Inc. operates as the holding company for First-Citizens Bank &amp; Trust Company that provides retail and commercial banking services to individuals, businesses, and professionals. The company's deposit products include checking, savings, money market, and time deposit accounts. Its loan product portfolio comprises commercial construction and land development, commercial mortgage, commercial and industrial, and lease financing loans, as well as small business administration paycheck protection program loans; and consumer loans, such as residential and revolving mortgage, construction and land development, consumer auto, and other consumer loans. The company also offers treasury services products, cardholder and merchant services, wealth management services, and various other products and services; investment products, including annuities, discount brokerage services, and third-party mutual funds, as well as invest
